  base: *id011
  body: "Since introduction of data types that don't have a corresponding type\r\n\
    in ES the `esType` is error-prone when used for `unmappedType()` calls.\r\nMoreover\
    \ since the renaming of `DATE` to `DATETIME` and the introduction\r\nof an actual\
    \ date-only `DATE` the `esType` would return `datetime` which\r\nis not a valid\
    \ type for ES mapping.\r\n\r\nFixes: #38051\r\n"
